import React from "react";
import "../css/aboutBlock.css";
import block2img from "../img/block2img.png";
function AboutBlock() {
  return (
    <section className="aboutBlock">
      <div className="container">
        <img src={block2img} />
        <article></article>
      </div>
    </section>
  );
}
export default AboutBlock;
